import React from 'react';
import 'bootstrap/dist/js/bootstrap.js';
// import RegistrationForm from './components/RegistrationForm';
// import SignIn from './components/SignIn';
// import Match from './gallery/Match';



function App() {
  return (
    <div className="App">
      {/* Carousel  */}
        <div id="demo" className="carousel-slide" data-bs-ride="carousel" ></div> 
        {/* Indicator Buttons */}
        <div className="carousel-buttons">
          <button type="button" data-bs-target="#demo" data-bs-slide-to="0" className="active></button>
          // <button type="button data-bs-target="#demo" data-bs-slide-to="1"></button>
          <button type="button" data-bs-target="#demo" data-bs-slide-to="2"></button>
          <button type="button" data-bs-target="#demo" data-bs-slide-to="3"></button>
          <button type="button" data-bs-target="#demo" data-bs-slide-to="4"></button>
        </div>

        {/* Slideshow  */}
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" className="d-block" width={{width: '100%'}} alt="friends" />
          </div>
          <div className="carousel-item active">
            <img src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" className="d-block" width={{width: '100%'}} alt="friends" />
          </div>
          <div className="carousel-item active">
            <img src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" className="d-block" width={{width: '100%'}} alt="friends" />
          </div>
          <div className="carousel-item active">
            <img src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" className="d-block" width={{width: '100%'}} alt="friends" />
          </div>
          <div className="carousel-item active">
            <img src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" className="d-block" width={{width: '100%'}} alt="friends" />
          </div>
        </div>

        {/* Left and right icons */}
        <button className="carousel-control-prev" type="button" data-bs-target="#demo" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-prev" type="button" data-bs-target="#demo" data-bs-slide="next">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
        {/* END CAROUSEL */}

</div>






  )}
