        <h1>Welcome To The Couples Connnect App!</h1>
         <h3>Where <i>Couples</i> Find <strong>Best Friends!</strong></h3>

        <body>
          <div className="container">
            <img height="700" width="1000" src="/melissa-askew-tSlvoSZK77c-unsplash.jpg" alt="friends" />
